import './App.css';


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Start />} />
        <Route path="game" element={<Game />} />
        <Route path="result" element={<Result />} />
      </Routes>

    </div>
  );
}

export default App;
